import React from 'react';
import axios from 'axios';
import './App.css';
import Board from './components/board'

class App extends React.Component {

  componentDidMount() {
    axios.get(`http://127.0.0.1:9393/test`)
    .then(res => {
      console.log(res.data);
    })
  }

  user(name) {
    axios.get(`http://127.0.0.1:9393/userStats?name=Tom`)
    .then(res => {
      console.log(res.data);
    })
  } 

  render() {
    return (
      <div>
        <form action={this.user(name)}>
          <input type="text" name="name"/>
          <input type="submit"/>
        </form>
        <Board />
      </div>
    )
  }
}

export default App;
